const from = new Date("2021-10-01T00:00:00.000Z");
const to = new Date("2021-10-31T23:59:59.999Z");

const range = {
  from, to
};

function roundToTwo(num) {
  return Math.round(num * 100 + Number.EPSILON) / 100;
}


function sumObjectsByKey(...objs) {
  return objs.reduce((a, b) => {
    for (let k in b) {
      if (typeof b[k] === "number") a[k] = roundToTwo((a[k] ?? 0) + b[k]);
    }
    return a;
  }, {});
}

const dateToStartOfMonth = (date) => DateTime.fromISO(date, { setZone: true }).startOf("month").toISO();

const groupOrderFinancials = (
  orderFinancials,
  range
) => {
  const output = {};
  let date = range.to;
  while (isAfter(date, range.from)) {
    output[dateToStartOfMonth(date)] = {
      grossRevenue: 0,
      shippingRevenue: 0,
      discounts: 0,
      returns: 0,
      cogs: 0,
    };
    date = subMonths(date, 1);
  }
  orderFinancials.forEach((financial) => {
    const financialDate = dateToStartOfMonth(financial.createdAt);
    output[financialDate] = sumObjectsByKey(output[financialDate], financial);
  });
  return output;
};

const result = orders.reduce((accum, elem) => {
  const date = new Date(elem.createdAt);
  if (date.getTime() >= from.getTime() && date.getTime() <= to.getTime()) {
    accum += elem.grossRevenue;
  }
  return accum;
}, 0);


